import './TableHeader.css';
import Checkbox from '../common/Checkbox';

import { ReactComponent as IconAbort    } from '..common/icons/abort.svg';
import { ReactComponent as IconBin      } from './icons/bin.svg';
import { ReactComponent as IconCheckmark} from './icons/checkmark.svg';
import { ReactComponent as IconDot      } from './icons/dot.svg';
import { ReactComponent as IconFilter   } from './icons/filter.svg';
import { ReactComponent as IconLocked   } from './icons/locked.svg';
import { ReactComponent as IconMoon     } from './icons/moon.svg';
import { ReactComponent as IconPencil   } from './icons/pencil.svg';
import { ReactComponent as IconRefresh  } from './icons/refresh.svg';
import { ReactComponent as IconSearch   } from './icons/search.svg';
import { ReactComponent as IconSun      } from './icons/sun.svg';
import { ReactComponent as IconVarrow   } from './icons/v_arrow.svg';
import { ReactComponent as IconXlarge   } from './icons/x-large.svg';
import { ReactComponent as IconXmedium  } from './icons/x-medium.svg';

const Icons = [
  <IconAbort     className="table__header-icon"/>,
  <IconBin       className="table__header-icon"/>,
  <IconCheckmark className="table__header-icon"/>,
  <IconDot       className="table__header-icon"/>,
  <IconFilter    className="table__header-icon"/>,
  <IconLocked    className="table__header-icon"/>,
  <IconMoon      className="table__header-icon"/>,
  <IconPencil    className="table__header-icon"/>,
  <IconRefresh   className="table__header-icon"/>,
  <IconSearch    className="table__header-icon"/>,
  <IconSun       className="table__header-icon"/>,
  <IconVarrow    className="table__header-icon"/>,
  <IconXlarge    className="table__header-icon"/>,
  <IconXmedium   className="table__header-icon"/>,
];

const TableHeader = ({
  title
}) => {
  return (
    <div className="table__header">

    </div>
  );
}

export default TableHeader;
